import './App.css';
import React from 'react';
import Header from './components/Header/Header';
import Options from './components/Options/Options';
import Control from './components/Control/Control';

function App() {
  return (
    <div className="appWrapper">
      <Header/>
      <Options/>
      <Control/>
    </div>
  );
}

export default App;
